import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { embedDashboard } from "@superset-ui/embedded-sdk";

export default function SupersetComponent() {
    const config = {
        id: "63e35e3d-df1b-4c89-b9ce-bdc0a691e2a6", // given by the Superset embedding UI
        supersetDomain: "https://superset.zone.ps",
        mountPoint: document.getElementById("container"), // any html element that can contain an iframe
        // fetchGuestToken: () => fetchGuestTokenFromBackend(),
        dashboardUiConfig: { hideTitle: true }, // dashboard UI config: hideTitle, hideTab, hideChartControls (optional)
      }
    /* JS code goes here */
    /* http://superset.zone.ps:8088/superset/dashboard/12 */
    return (
        <Container>
            <script src="https://unpkg.com/@superset-ui/embedded-sdk"></script>

            <script>
                supersetEmbeddedSdk.embedDashboard(config);
            </script>
        </Container>

        
        // <Container>
        //     <script>
